import React, { Component } from 'react';

class Landing extends Component {
  state = {
    isAuthenticated: false,
    name: '',
    email: ''
  }

  componentDidMount(){
    var user = localStorage.getItem("User");
    if (user){
      this.setState({isAuthenticated: true,
                     name: user.name,});
    }
  }
  render() {
    return (
      <div className="App">
        Landing {this.user.name}
      </div>
    );
  }
}

export default Landing;
